Unable to update User games property when user creaties a new game mongoose<p>I'm working on an app where users can create and account and make trivia games. <code>User</code> has a property called <code>games</code> which is a collection of <code>Game</code> id's that that <code>User</code> instance has created. When I create a <code>Game</code> instance, before I return the response (<code>JSON</code> of new <code>Game</code> instance), I find the <code>User</code> instance and use a <code>User</code> schema method to add the newly created <code>Games</code> id to the collection of game ids in the <code>User</code>'s games property. It seems to work when I create a game, I was able to log the instance of <code>User</code> with the array reflecting the newly added <code>Game</code> id. </p>

<p>But then when I try to get the <code>User</code> via <code>localhost:4000/users/USER_ID</code> the <code>games</code> property remains empty. </p>

<p>Here is my <code>User</code> Model.</p>

<pre><code>const mongoose = require("mongoose");
const validator = require("validator");
const bcrypt = require('bcryptjs')
const jwt = require('jsonwebtoken')
const Schema = mongoose.Schema;

let User = new Schema({
  username: {
     type: String, required: true, trim: true, default: null,
     unique: true
  },
  password: {
     type: String, required: true, trim: true, default: null
  },
  games:{
     type: Array, required: false, default: []
  }
});

User.methods.addGame = async function(id) {
  const user = this;
  var games = user.games;
  games.push(id);
  user.games = games;
  user.save()
  return user
}

module.exports = mongoose.model('User', User);
</code></pre>

<p>Here is my root <code>/users</code> route and my <code>/users/:id</code> route.</p>

<pre><code>userRoutes.route('/').get(function(req, res){
  User.find(function(err, users){
    if(err){
       res.status(400).send(err);
    } else {
       res.json(users)
    }
  });
});

userRoutes.route('/:id').get(function(req, res){
   User.findById(req.params.id, function(err, user){
     if(err){
       res.status(400).send(err)
     } else {
       if (user){
          res.status(200).json(user);
       } else {
          res.status(400).send('user not found :(')
       } 
    }
  });
});
</code></pre>

<p>And here is my <code>add</code> game route.</p>

<pre><code>gameRoutes.route('/add').post( async function(req, res){
  try {
    var user = await User.findOne({ _id: req.body.owner })
    let game = new Game(req.body);
    if (!user){
      res.status(400).send('user not found.')
    } else {
      await game.save()
      await user.addGame(game._id);
      if (!game){
        res.status(400).send('game cannot be created');
      } else {
        res.status(200).json(game);
      }
    }
  } catch (error) {
    res.status(500).send(error);
  }
});
</code></pre>

<p>Finally, here is the data that is logged when I use <code>mongoose.set('debug', true)</code> and create a game.</p>

<pre><code> Mongoose: users.findOne({ _id: ObjectId("5daca0171febbb25f2c929dd") }, 
 { projection: {} })
 Mongoose: games.insertOne({ questions: [ { id: 0, qTitle: 'When is 
 Independence Day?', qAnswers: [ { aId: 0, aContent: 'July 18th' }, { 
 aId: 1, aContent: 'July 19th' }, { aId: 2, aContent: 'July 30th' }, { 
 aId: 3, aContent: 'July 4th' } ], answer: 3, correct: null }, { id: 1, 
 qTitle: 'When is Christmas Day?', qAnswers: [ { aId: 0, aContent: 
 'July 18th' }, { aId: 1, aContent: 'July 19th' }, { aId: 2, aContent: 
 'December 25th' }, { aId: 3, aContent: 'December 31st' } ], answer: 2, 
 correct: null } ], qTime: null, expDate: null, isPrivate: true, 
 isClosed: false, _id: ObjectId("5db5c2fe96960e318ae8f60f"), name: 
 'poppie', __v: 0 }, { session: null })
 Mongoose: users.updateOne({ _id: ObjectId("5daca0171febbb25f2c929dd"), 
 __v: 19 }, { '$set': { games: [ ObjectId("5db5c2fe96960e318ae8f60f") ] 
 }, 
 '$inc': { __v: 1 } }, { session: undefined })
</code></pre>

<p>Right after creating a game, if I go to <code>/localhost:4000/users</code> I see the resulting list of <code>User</code>'s.</p>

<pre><code> [{
    "username": "matt_cee",
    "password": 
    "$2a$10$/ySrwkMxaHGO24FOEst3NuqpG4iQi78BUCSkl4Hb.RmjTIwynR3l.",
    "games": [
        "5db5c2fe96960e318ae8f60f"
    ]
  }]
</code></pre>

<p>As you can see, the <code>games</code> array contains the newly created game's id. I am able to log the updated <code>User</code> in the <code>/add</code> games route but when accessing the <code>/:id</code> user route, the returned <code>User</code> instance has an empty array for the games property. </p>

